import React, { Component } from 'react'
import NumberChild from './num-child/component'

import './style.css'

class NumGen extends Component {

  render() {

    console.log(this)

    function childComponentNumber(min, max) {
      min = Math.ceil(min);
      max = Math.floor(max);
      return Math.floor(Math.random() * (max - min + 1)) + min; //The maximum is inclusive and the minimum is inclusive 
    }

    // Could not reference "this" inside of for-loop below
    // Declared these variables to reference #clojure
    let minimum = this.props.min
    let maximum = this.props.max

    let childArray = []

    function generateChildComponents(arg) {
      for(let i = 0; i < arg; i++) {
        childArray.push(<NumberChild value={childComponentNumber(minimum, maximum)} key={i}/>)
      }
      return childArray
    }

    return (
      <div className="numgen-wrapper border-box-gl flex-container-gl">
        {this.props.name}
        {generateChildComponents(this.props.howMany)}
      </div>
    );
  }
}

export default NumGen;
